'''You are given an array non-negative integers height which represent an elevation map. Each value height[i] represents the height of a bar, which has a width of 1.
Return the maximum area of water that can be trapped between the bars.
Constraints:
1 <= height.length <= 1000
0 <= height[i] <= 1000'''



from time import time
class Solution:
    @staticmethod
    def trap_brute_force(height: list[int]) -> int: #O(n^2)
        trapped_water_array = [0]*len(height)
        for i,h in enumerate(height):
            left_val , right_val = max(height[0:i+1]),max(height[i:])
            left_position , right_position = height.index(left_val,0,i+1), height.index(right_val,i)
            trapped_water_array[i] = min(height[left_position],height[right_position])-h
        return sum(trapped_water_array)


    @staticmethod
    def trap_brute_force_optimal(height: list[int]) -> int: #time:O(n) space:O(n)
        n = len(height)
        left_max = [0] * n
        right_max = [0] * n
        left_max[0] = height[0]
        right_max[-1] = height[-1]

        # Precompute left_max and right_max
        for i in range(1, n):
            left_max[i] = max(left_max[i - 1], height[i])
        for i in range(n - 2, -1, -1):
            right_max[i] = max(right_max[i + 1], height[i])

        # Compute trapped water
        trapped = 0
        for i in range(n):
            trapped += min(left_max[i], right_max[i]) - height[i]
        return trapped

    # we only need minimum height from both the side
    @staticmethod
    def trap_two_pointer(height: list[int]) -> int: #time:O(n) space:O(1)
        l,r= 0,len(height)-1
        left_max,right_max =height[l], height[r]
        trapped_water =0

        while l<r:
            if left_max < right_max:
                l +=1
                left_max=max(left_max,height[l])
                trapped_water += left_max - height[l]
            else:
                r -= 1
                right_max= max(right_max,height[r])
                trapped_water += right_max - height[r]

        return  trapped_water

